metadata.description:
Riding the soundscapes like waves, drifting through realms and gliding between dimensions, Astra Etherea embodies the esoteric phenomena of melodies transporting our celestial beings out of body and into the astral plane when we fully immerse ourselves in audio.


Astra encompasses the idea of cybernetics entangled with spirituality in relation to music. 

 
